// src/assets/images.js
const images = [
    {
      id: 1,
      url: "https://source.unsplash.com/random/800x600?nature,water",
      title: "Mountain View",
    },
    {
      id: 2,
      url: "https://source.unsplash.com/random/800x600?nature,forest",
      title: "Forest Trail",
    },
    {
      id: 3,
      url: "https://source.unsplash.com/random/800x600?city,night",
      title: "City Lights",
    },
    {
      id: 4,
      url: "https://source.unsplash.com/random/800x600?beach,sunset",
      title: "Beach Sunset",
    },
  ];
  
  export default images;
